INSERT INTO methods (recipe_id, step, instruction)
VALUES
    (1, 0, "For the pastry, place flour and a pinch of salt in a bowl. Using your fingers, rub in butter until it resembles coarse crumbs. Add egg yolk and thyme. Combine vinegar and 1/4 cup (60ml) water in a jug with 4 ice cubes. Drain, then fold into flour mixture until it forms a shaggy dough. Enclose in plastic wrap and chill for 2 hours."),
    (1, 1, "Preheat oven to 200C."),
    (1, 2, "Roll out pastry on a lightly floured work surface to 3mm thick and use to line a 24cm fluted ceramic dish, trimming excess. Line with baking paper and fill with pastry weights. Bake for 25 minutes or until light golden. Remove weights and paper, and bake for a further 20 minutes or until base is cooked."),
    (1, 3, "Reduce oven to 160C."),
    (1, 4, "Heat oil in a frypan over low heat. Add onion and 1/2 tsp salt. Cook, stirring, for 12 minutes or until caramelised. Cool. Add to pastry case with half rosemary leaves and 100g feta.."),
    (1, 5, "Whisk egg, milk and paprika in a bowl. Season and pour into pastry case. Coat sweet potato with maple and arrange over filling. Scatter with remaining 50g feta and rosemary."),
    (1, 6, "Bake for 1 hour or until just set. Cool slightly, then serve."),
    (2, 0, "For the dukkah, combine everything in a small container and set aside."),
    (2, 1, "Heat 2 tbs oil in a frypan over medium heat. Add eschalot and cook 2-3 mintues until softened. Add garlic, ginger, chilli and lemongrass. Cook 1 minute until fragrant. Add tomatoes and canned tomatoes, and bring to a boil. Add fish sauce. Simmer 15 minutes until thickened."),
    (2, 2, "Heat 2cm oil in a saucepan over mediumhigh heat. Dust tofu in rice flour, then shallow fry in batches until golden and crisp. Drain on paper towel and season."),
    (2, 3, "In a frypan, heat remaining 2 tbs oil over medium heat and fry eggs 2 minutes or until cooked to your liking."),
    (2, 4, "Divide tomato mixture and snake beans among plates. Top with egg, tofu, dukkah and mint. Serve with crusty bread."),
    (3, 0, "For the dressing, place all ingredients in a small bowl. Whisk until sugar has dissolved. Set aside."),
    (3, 1, "In a large bowl, combine eggs, coconut milk and turmeric. Season. Set aside."),
    (3, 2, "In another bowl, combine spring onion, bean sprouts, mung bean sprouts, leaves, herbs and chilli."),
    (3, 3, "Heat  tbs oil in a 20cm non-stick frypan over high heat. Pour in a quarter of the egg mixture, then tilt and rotate the pan to evenly spread. Using a heatproof rubber spatula draw mixture into centre, tilting the pan so uncooked egg runs underneath. Cook for 1 minute or until egg is set but still soft."),
    (3, 4, "Take off heat, scatter with a quarter of the salad mixture and 5 prawns down the centre of the omelette, and spoon over 1 tbs dressing."),
    (3, 5, "Gently fold one side of the omelette over the filling. Slide onto a serving plate."),
    (3, 6, "Repeat to make 4 omelettes. Serve with extra dressing if desired."),
    (4, 0, "Heat oil in a large non-stick pan over medium heat. Add onion, ginger, chilli, curry leaves and garlic. Cook for 5 minutes or until soft. Add garam masala and cook for a further 1 minute or until fragrant. Add tomatoes plus  cup (180ml) water, and stir to combine."),
    (4, 1, "Bring to the boil, then lower heat to a simmer, and cook, stirring occasionally, for 5 minutes or until sauce has thickened. Add okra, stir to coat, and simmer for 7 minutes. Season."),
    (4, 2, "Meanwhile, in a large saucepan, soft-boil eggs in boiling water for 7 minutes. Drain, remove shells, and halve."),
    (4, 3, "Serve curry with rice and naan bread and top with eggs, yoghurt, coriander, extra chilli and fried curry leaves."),
    (5, 0, "Place rinds and 5 cups (1.25L) cold water in a saucepan over high heat and bring to the boil. Reduce heat to a gentle simmer and cook, partially covered, for 1 hour to infuse. Discard rinds."),
    (5, 1, "Increase heat to high and bring stock to the boil. Add corn, return to the boil and stir through spinach and parmesan (it will seem like a lot of corn, but dont worry)."),
    (5, 2, "In batches, transfer soup to a blender and whiz until smooth. Transfer to a saucepan over low heat to keep hot."),
    (5, 3, "Meanwhile, bring a saucepan of water to the boil, carefully add eggs and boil for 41/2 minutes. Drain and immediately transfer to a bowl of iced water. When cool enough to handle, peel carefully."),
    (5, 4, "Divide soup among serving bowls and gently top with a halved egg. Scatter with parsley and extra parmesan to serve."),
    (6, 0, "Heat oven to 200C/180C fan/gas 6. Line a 21 or 22cm square, shallow baking tin with baking parchment. Put the flour, ground rice and sugar in a bowl with the butter and rub in until fine crumbs form. Stir in the milk with a cutlery knife. Tip into the tin and press down evenly. Bake for 15-20 mins until golden."),
    (6, 1, "Remove the tin and lower oven to 180C/160C fan/gas 4. Mix the lemon juice and eggs, then sieve into a bowl with the sugar, flour and zest. Whisk to combine, pour over the base, then bake for 10-15 mins until the top is just set. Cool in the tin, dust with icing sugar, then slice."),
    (7, 0, "Whip the cream and sugar together until soft peaks form. Stir in the wine, most of the lemon zest and the juice. Spoon into glasses or bowls, sprinkle with the remaining zest and serve with almond thins or berries."),
    (8, 0, "Combine potato, onion, mustard, lemon zest and juice, crackers, crabmeat, egg and 2 tablespoons parsley, then season well. Form into 8 small patties, then chill for 15 minutes to firm up."),
    (8, 1, "Meanwhile, combine mayonnaise, dill and remaining 1 tablespoon parsley in a small bowl. Season to taste, then chill until needed."),
    (8, 2, "Heat 2cm oil in a large pan over medium-high heat. Fry crab cakes for 1-2 minutes each side until crisp and golden. Garnish with parsley and serve with lime wedges and dill mayonnaise."),
    (9, 0, "Use a sharp knife to cut down the length of the corn, close to the core, to remove the kernels."),
    (9, 1, "Place the corn, stock and ginger in a large saucepan. Cover and bring to the boil over high heat. Reduce heat to medium and simmer, uncovered, for 5 minutes or until the corn softens slightly."),
    (9, 2, "Meanwhile, whisk together the soy sauce, cornflour and 1 tablespoon of water in a small bowl until smooth. Whisk together the egg whites and remaining water in a bowl."),
    (9, 3, "Add the cornflour mixture to the corn mixture and stir until well combined. Cook for 1 minute or until the soup thickens slightly. Gradually add the egg mixture in a thin, steady stream, stirring constantly until combined. Stir in the crab meat and shallot. Season with pepper. Ladle among serving bowls and sprinkle with the coriander. Serve."),
    (10, 0, "Combine the mayonnaise, lime juice, lime zest and cayenne pepper in a large bowl."),
    (10, 1, "Add the crab meat and stir until combined. Mix in the corn, cucumber and onion."),
    (10, 2, "Halve and remove the seed and skin from each avocado. Use a small knife to cut the flesh into 2cm pieces. Add to the bowl and mix gently to combine. Season with salt."),
    (10, 3, "Divide coriander among plates. Top with salad. Sprinkle with a little extra cayenne pepper.");
